    of a specifically identified federal candidate, and no expenditure was for a public
    communication that referred to a clearly identified candidate for Federal office
    and that promoted, supported, attacked or opposed any such candidate for Federal
    office. No expenditure was for a public communication or voter drive activity
    containing express advocacy or that referred to a clearly identified candidate
    for Federal office and that promoted, supported, attacked or opposed any such
    candidate for Federal office. The payments disclosed on Schedule B for Line 21(b)
    for fundraising activities did not constitute public communications that referred
    to a clearly identified candidate for Federal office and that promoted, supported,
    attacked or opposed any such candidate for Federal office. While these disbursements
    were eligible for allocation using the funds-received method, the Committee elected
    to pay these expenses with 100% federal funds. No employee of the Committee spent
    more than 25% of compensated time during any month within the reporting period
    engaged in Federal Election Activity. Payments for salaries and related fringe
    benefits disclosed on Schedule H4 are for employees who spent less than 25% of
    their time engaged in activities in connection to any federal election. The refund
    from a non-federal candidate disclosed on Schedule H4 is a refund for use supplies
    in inventory and previously paid as allocated expenses.\n"
